INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3222471624098', 'Sauces classiques - Sauce béarnaise Sauce poivre Sauce tartare aux cornichons et aux câpres Sauce bourguignonne', 'Sauce béarnaise : eau - huile de colza - sirop de glucose-fructose - vinaigre d\'alcool - jaune d\'_oeuf_ - amidon transformé de maïs - sel - échalote réhydratée 1.8% - plantes aromatiques réhydratées : estragon 1.6%, persil - amidon de maïs - acidifiants : glucono-delta-lactone, acide citrique - arôme naturel d\'estragon - jus de citron concentré - épaississants : gomme guar, gomme xanthane - conservateur : sorbate de potassium - colorant : bêta-carotène - arôme naturel d\'aneth. Sauce bourguignonne : huile de colza - purée de tomates double concentrée 16% - eau - dextrose - vinaigre d\'alcool - jaune d\'_oeuf_ - sel - vin rouge 1,9% - amidon transformé de maïs - arômes (dont _céleri_) - épaississant : gomme xanthane - piment en poudre - colorant : extrait de paprika. Sauce au poivre noir : huile de colza - eau - sirop de glucose-fructose - vinaigre d\'alcool - jaune d\'_oeuf_ - sel - poivre noir 2,2% - amidon de _blé_ - Brandy - _moutarde_ de Dijon (eau - graines de _moutarde_ - vinaigre d\'alcool - sel - acidifiant : acide citrique) - amidon transformé de maïs - épaississants : gomme guar, gomme xanthane - colorant : bêta-carotène. Sauce tartare : Huile de colza - eau - sirop de glucose-fructose - jaune d\'_oeuf_ - cornichons 3,7% - câpres 3% - sel - amidon transformé de maïs - vinaigre de vin blanc - acidifiants : glucono-delta-lactone, acide citrique, acide acétique - vinaigre d\'alcool - oignons déshydratés - _moutarde_ de Dijon (eau - graines de _moutarde_ - vinaigre d\'alcool - sel - acidifiant : acide citrique) - échalotes déshydratées 0.2% - persil déshydraté 0.14% - conservateur : sorbate de potassium - épaississants : gomme guar, gomme xanthane.', '', '51', '4.1', '9.6', '8', '', '1.4', '3.1', '1.22047244094488', '', '0');

