INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3222471915462', 'Riz à la cantonaise', 'Riz Basmati cuit 68% (eau - riz Basmati) - petit pois doux 7% - omelette 6,5% (_oeuf_ entier - blanc d\'_oeuf_ - _lait_ écrémé reconstitué - huile de tournesol - sel - épaississants : gomme xanthane, gomme guar - acidifiant : acide citrique) - épaule cuite standard traitée en salaison 6,5% [épaule de porc (origine : UE) 4% - eau - sel - plasma de porc - gélatine F de porc - sirop de glucose - dextrose - stabilisant : triphosphates - gélifiant : carraghénanes  - arômes naturels - antioxydant : érythorbate de sodium - conservateur : nitrite de sodium] - carotte 4% - sauce nuoc-mâm 2,1% (extrait de _poisson_ - sel - sucre) - huile de tournesol - eau - ail - gingembre - amidon transformé - coriandre - poivre blanc. Traces de _céleri_.', 'https://static.openfoodfacts.org/images/products/322/247/191/5462/front_fr.16.400.jpg', '3.4', '0.5', '25', '0.6', '0.9', '4.2', '0.71', '0.279527559055118', '', '1');

