VALUES ('3222471915783', 'Tiramisu - au mascarpone', 'Sirop de glucose de maïs - _lait_ écrémé reconstitué - génoise 10% (farine de _blé_ - sucre - _oeufs_ - fécule de pomme de terre - émulsifiant: mono - et diglycérides d\'acides gras - huile de coco - poudres à lever: diphosphates, carbonates de sodium - sel) - huile de coco - _mascarpone_ 3,8% (_crème_ pasteurisée - correcteur d\'acidité : acide lactique) - alcool - _oeufs_ - vin Marsala 1,3% - humectant: sorbitols - _lait_ écrémé en poudre - amidon de tapioca - cacao 0,6% - café soluble 0,5% - dextrose - gélatine de porc - épaississants: farine de graines de caroube, alginate de sodium - émulsifiant : esters lactiques des mono - et diglycérides d\'acides gras - amidon de _blé_ - arôme naturel - sucre - beurre de cacao. Teneur en Alcool 2,0%. Traces de _soja_ et _fruits à coque_.', 'https://static.openfoodfacts.org/images/products/322/247/191/5783/front_fr.12.400.jpg', '9.3', '8.2', '41', '16', '', '2.8', '0.1', '0.0393700787401575', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3222471917121', 'Petits fours pâtissiers aux 3 chocolats', 'Farine de _blé_, chocolat au _lait_ 19% (sucre - beurre de cacao - _lait_ entier en poudre - pâte de cacao - _lactose_ - émulsifiant : lécithine de _soja_), sucre, huiles et graisses végétales (palme, colza, coprah, palmiste), chocolat noir 10% (sucre, pâte de cacao, beurre de cacao, matière grasse _laitière_ anhydre, émulsifiant : lécithine de _soja_, arôme naturel de vanille), chocolat blanc 5,2% (sucre, beurre de cacao, _lait_ entier en poudre, émulsifiant : lécithine de _soja_, arôme naturel de vanille), _noisettes_ caramélisées 1,1% (sucre, _noisettes_), fourrage _lait_ [huiles végétales (palme, tournesol, colza, coton), sucre, _lait_ écrémé en poudre, _lactose_, cacao maigre en poudre, émulsifiant : lécithine de _soja_], sirop de sucre inverti, _oeufs_, caramel au sel de Guérande 0,9% [sirop de glucose, sucre, graisses végétales (palme, palmiste), _beurre_, eau, _crème_ liquide à 31% de matière grasse, sel de Guérande 1,2%, émulsifiant : lécithine de _soja_], farine de _soja_, _amandes_ effilées 0,5%, dextrose, blanc d\'_oeuf_, nougatine 0,4% (sucre, _noisettes_), chocolat en flocons (sucre, pâte de cacao, beurre de cacao, _lait_ entier en poudre, matière grasse _laitière_ anhydre, arôme naturel de vanille), cacao maigre en poudre 0,3% (dont émulsifiant : lécithine de _soja_), noix de coco 0,1%, sel, poudres à lever : carbonates de sodium, carbonates d\'ammonium, diphosphates, _lait_ écrémé en poudre, arômes naturels, _lait_ entier en poudre, huile d\'_arachide_, farine de riz, émulsifiant : lécithine de _soja_, cannelle.', 'https://static.openfoodfacts.org/images/products/322/247/191/7121/front_fr.10.400.jpg', '27', '15.5', '63', '41', '2.2', '6', '0.36', '0.141732283464567', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
